import { StyleSheet, View, Text } from "react-native";

const Modal = () =>
    <View style={styles.modal}>
        <View>
            <Text>Lorem ipsum dolor sit amet consectetur adipisicing elit. Incidunt sapiente perspiciatis velit explicabo saepe temporibus repellat deleniti minus maxime veniam dolorum qui consequuntur, id reiciendis maiores voluptates enim. Dignissimos, quod.</Text>
        </View>
    </View>

const styles = StyleSheet.create({
    modal: {
        position: "absolute",
        top: 0,
        opacity: 1,
        flex: 1,
        backgroundColor: "red"
    }
});

export default Modal;
